const questions = [
  {
    question: "造成次發性高血壓（secondary hypertension）的病因，不包括下列何者？",
    answers: [
      { id: "1", text: "庫興氏症候群（Cushing's syndrome）" },
      { id: "2", text: "嗜鉻細胞瘤（pheochromocytoma）" },
      { id: "3", text: "愛迪生氏症（Addison's disease）", correct: true },
      { id: "4", text: "慢性腎臟疾病（chronic kidney disease）" }
    ]
  },
  {
    question: "What kind of fruit was used to name a computer in 1984?",
    answers: [
      { id: "1", text: "Blackberry" },
      { id: "2", text: "Blueberry" },
      { id: "3", text: "Pear" },
      { id: "4", text: "Apple", correct: true }
    ]
  }
];

export default questions;
